import React from "react";

interface LevelTickerProps {
  user: {
    earnPerTap: number;
    coinsToLevelUp: number;
    profitPerHour: number;
    totalCoins: number;
  };
}

const LevelTicker: React.FC<LevelTickerProps> = ({ user }) => {
  return (
    <div className="level-ticker">
      <div className="earn-per-tap-field">
        <h4>Earn per tap</h4>
        <div>
          <img className="coin-symbol"></img>
          <p className="count-field">{}</p>
        </div>
      </div>
      <div className="coins-to-level-up-field">
        <div>
          <h4>Coins to level up</h4>
          <p className="count-field">{coinsToLevelUp}</p>
        </div>
      </div>
      <div className="profit-per-hour-field">
        <div>
          <h4>Profit per hour</h4>
          <p className="count-field">{profitPerHour}</p>
        </div>
      </div>
    </div>
  );
};

export default LevelTicker;
